        string memory dstCourse,
        uint8 month,
        uint16 year
    ) public onlyOwner participantIsDegreeCoord(degreeCoord) returns (uint) {
        uint id = validations.mintNFT(
            msg.sender,
            degreeCoord,
            srcCourse,
            dstCourse
        );

        validations.setValidityPeriod(degreeCoord, id, month, year);
        return id;
